import React, { useState } from 'react';
import axios from 'axios';
import CodeMirror from '@uiw/react-codemirror';
import { python } from '@codemirror/lang-python';
import { javascript } from '@codemirror/lang-javascript';
import { cpp } from '@codemirror/lang-cpp';
import { githubDark } from '@uiw/codemirror-theme-github';

function App() {
  const [code, setCode] = useState('');
  const [language, setLanguage] = useState('python');
  const [analysis, setAnalysis] = useState(null);
  const [loading, setLoading] = useState(false);

  // Language extensions mapping
  const languageExtensions = {
    python: python(),
    javascript: javascript(),
    cpp: cpp()
  };

  const handleDebug = async () => {
    setLoading(true);
    try {
      console.log("Sending code for analysis:", { code, language }); // Debug log
      const response = await axios.post('http://localhost:5001/analyze', {
        code,
        language
      });
      console.log("Received response:", response.data); // Debug log
      setAnalysis(response.data);
    } catch (error) {
      console.error("Full error:", error); // Debug log
      console.error("Error response:", error.response); // Debug log
      setAnalysis({ 
        error: error.response?.data?.message || "Failed to analyze code" 
      });
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ padding: '20px', maxWidth: '800px', margin: '0 auto' }}>
      <h1>AI Code Debugger</h1>
      
      <div style={{ marginBottom: '15px' }}>
        <select 
          value={language}
          onChange={(e) => setLanguage(e.target.value)}
          style={{ padding: '5px', borderRadius: '4px', border: '1px solid #ddd' }}
        >
          <option value="python">Python</option>
          <option value="javascript">JavaScript</option>
          <option value="cpp">C++</option>
        </select>
      </div>

      {/* Modern CodeMirror component */}
      <CodeMirror
        value={code}
        height="300px"
        extensions={[languageExtensions[language]]}
        theme={githubDark}
        onChange={(value) => setCode(value)}
        style={{ 
          marginBottom: '15px',
          border: '1px solid #ddd',
          borderRadius: '4px',
          overflow: 'hidden'
        }}
      />

      <button 
        onClick={handleDebug}
        disabled={loading}
        style={{ 
          padding: '8px 15px',
          background: loading ? '#ccc' : '#007bff',
          color: 'white',
          border: 'none',
          borderRadius: '4px',
          cursor: 'pointer',
          fontSize: '16px',
          marginBottom: '20px'
        }}
      >
        {loading ? 'Analyzing...' : 'Debug with AI'}
      </button>

      {analysis && (
        <div style={{ 
          marginTop: '20px', 
          padding: '20px', 
          background: '#f8f9fa', 
          borderRadius: '4px',
          border: '1px solid #eee'
        }}>
          <h3 style={{ marginTop: 0 }}>Analysis Results</h3>
          
          {analysis.errors && analysis.errors.length > 0 && (
            <div style={{ color: '#dc3545', marginBottom: '15px' }}>
              <h4 style={{ marginBottom: '8px' }}>Errors Found:</h4>
              <ul style={{ paddingLeft: '20px', margin: 0 }}>
                {analysis.errors.map((error, i) => (
                  <li key={i} style={{ marginBottom: '5px' }}>{error}</li>
                ))}
              </ul>
            </div>
          )}

          {analysis.suggestions && analysis.suggestions.length > 0 && (
            <div style={{ color: '#fd7e14', marginBottom: '15px' }}>
              <h4 style={{ marginBottom: '8px' }}>Suggestions:</h4>
              <ul style={{ paddingLeft: '20px', margin: 0 }}>
                {analysis.suggestions.map((suggestion, i) => (
                  <li key={i} style={{ marginBottom: '5px' }}>{suggestion}</li>
                ))}
              </ul>
            </div>
          )}

          {analysis.ai_analysis && (
            <div style={{ marginTop: '15px' }}>
              <h4 style={{ marginBottom: '8px' }}>AI Analysis:</h4>
              <div style={{ 
                background: '#fff', 
                padding: '15px', 
                borderRadius: '4px',
                border: '1px solid #ddd',
                whiteSpace: 'pre-wrap',
                fontFamily: 'monospace'
              }}>
                {analysis.ai_analysis}
              </div>
            </div>
          )}

          {analysis.error && (
            <div style={{ color: '#dc3545', marginTop: '15px' }}>
              <p>{analysis.error}</p>
            </div>
          )}
        </div>
      )}
    </div>
  );
}

export default App;
